import React from 'react';
import {FaBars, FaUser, FaHeart} from 'react-icons/fa';
import {animateScroll as scroll} from 'react-scroll'
import{ 
  Nav, 
  NavbarContainer, 
  NavLogo, 
  MobileIcon, 
  NavMenu, 
  NavItem, 
  NavLinks,
  NavBtn,
  NavBtnLink
} from './NavbarUserElements';

const NavbarUser = ({ toggle }) => {

  const toggleHome = () => {
    scroll.scrollToTop();
  }

  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo to="/" onClick={toggleHome}>Crafty</NavLogo>
          <MobileIcon onClick={toggle}>
            <FaBars />
          </MobileIcon>
          <NavMenu>
            <NavItem>
              <NavLinks 
                to="albums"
                smooth={true}
                duration={500}
                spy={true}
                exact='true'
                offset={-80}
              >
                Albums
                </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks 
                to="postcards"
                smooth={true}
                duration={500}
                spy={true}
                exact='true'
                offset={-80}
              >
                Postcard
                </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks 
                to="exploadingBoxes"
                smooth={true}
                duration={500}
                spy={true}
                exact='true'
                offset={-80}
                >
                  Exploading Boxes
                  </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks to="matchboxes">Mini Presents</NavLinks>
            </NavItem>
          </NavMenu>
          <NavBtn>
              <NavBtnLink to="/products">Log in</NavBtnLink>
            </NavBtn>
        </NavbarContainer>
      </Nav>
    </>
  )
}

export default NavbarUser;
